  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116409 includes chemical,
  discrete sample, physical and profile data collected from FRANKLIN in the Coral
  Sea and Tasman Sea from 1993-06-24 to 1993-07-17 and retrieved during cruise PACIFICA_09FA19930624.
  These data include DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, SALINITY,
  SILICATE and WATER TEMPERATURE. The instruments used to collect these data include
  CTD and bottle. These data were collected by John A. Chruch of Commonwealth Scientific
  and Industrial Research Organization as part of the PACIFICA_09FA19930624 data set.nnThe
  International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
  out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
  to quantify changes in storage and transport of heat, fresh water, carbon dioxide
  (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
